import React from 'react';
import Upload from './components/Upload';
import './App.css';

const App = () => (
  <div className='container mt-4'>
    <h4 className='display-4 text-center mb-4'>
      <i className='fab fa-react' /> OTTO Mottors Challenge
    </h4>

    <Upload />
  </div>
);

export default App;
